import './App.css';
import JobList from './components/JobList';
import JobForm from './components/JobForm';
import Navbar from './components/Navbar';
import Sidebar from './components/Sidebar';

function App() {
  return (
    <>
    <header>
      <Navbar />
    </header>
    <body>
        <Sidebar />
          <JobForm />
          <JobList />
    </body>
    </>
  );
}

export default App;
